import { SET_PRODUCTS } from "./constants"

const initialState={
    product:[
        {
            id:1,
            title:'Dipesh',
            category:'programmer'
        }
    ],

}
export const productReducer =(state = initialState, action)=>{
    switch(action.type){
        case SET_PRODUCTS:
            return state
        default: return state
    }
}
